pub fn geeco_bench<M: Measurement + 'static>(c: &mut Criterion<M>, contract: &str, fun: &str) {
    let modules = compile_modules();

    geeco_call(c, modules, contract, fun);
}

fn geeco_call<M: Measurement + 'static>(c: &mut Criterion<M>, modules:Vec<u8>, contract: &str, func: &str)    {
    let vm_kind = VMKind::GeeCo; 
    let balance =  Amount::from_gtu(0);
    //account1
    let address1 = String::from("0xf6b02a2d47b84e845b7e3623355f04tbi0000001");
    //account2
    let address2 = String::from("0xf6b02a2d47b84e845b7e3623355f04tbi0000002");
    //account3
    let address3 = String::from("0xf6b02a2d47b84e845b7e3623355f04tbi0000003");
    //contract address
    let contract_address = String::from("0xf6b02a2d47b84e845b7e3623355f04tbi0000009");

    let sender = Address::Account(AccountAddress::from(address1));
    let invoker = AccountAddress::from(address2);
    let owner = AccountAddress::from(address3);
    let state:Vec<u8> = vec![48, 120, 102, 54, 98, 48, 50, 97, 50, 100, 52, 55, 98, 56, 52, 101, 56, 52, 53, 98, 55, 101, 51, 54, 50, 51, 51, 53, 53, 102, 48, 52, 102, 105, 98, 48, 48, 48, 48, 48, 48, 49];

    let call_ctx = Context::new_call(
        contract,
        func,
        &[],
        &state,
        balance,
        sender,
        invoker,
        owner,
        AccountAddress::from(contract_address.clone()),
        1000_000,
        true
    );
    let mut contract = Runtime{ context: call_ctx, vm_kind: vm_kind.clone() };

    // benchmark
    c.bench_function(func, |b| {
        b.iter(|| {
            let ret = contract.run(&modules, 0);
            match ret{
                Ok(r) => {
                    match r{
                        ContractResult::Success { remaining_energy, actions, event }=> (),//println!("tbi c success :{:?}", remaining_energy),
                        ContractResult::Data { data,remaining_energy, event }=> println!("tbi c data :{:?}", data),
                        ContractResult::Reject{ reason, remaining_energy } => println!("tbi c reject :{:?}--{:?}", reason, remaining_energy),
                        ContractResult::OutOfEnergy=> println!("tbi c outofe."),
                    };
                },
                Err(err)=>println!("tbi c err :{:?}", err),
            }
        })
    });
}